import React from 'react'
import './IndivisiualImage.css';
export const IndivisiualImage = ({images}) => {

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1
      };
    return images.map((image)=>(

        <div className='photo'>
            <img  src={image.urls.small} alt='photo'></img>
        </div>
    ));
}
